	/*metodos para manejo de etiquetas*/
	public void agregarEtiqueta(String valor){
			boolean add=true;
			for(Etiqueta eti: this.listaEtiquetas){
				if (eti.getValor().equals(valor)){
					/* code */
					add=false;
					break;
				}
			}
			if (add){
				listaEtiquetas.add(new Etiqueta(valor));
			} else {
				listaErrores.add("Error: Existen etiquetas con el mismo nombre en la accion NUEVA_PAGINA...");
			}
	}
	public void agregarEtiqueta2(String valor){
			boolean add=true;
			for(Etiqueta eti: this.listaEtiquetas2){
				if (eti.getValor().equals(valor)){
					/* code */
					add=false;
					break;
				}
			}
			if (add){
				listaEtiquetas2.add(new Etiqueta(valor));
			} else {
				listaErrores.add("Error: Existen etiquetas con el mismo nombre en la accion NUEVA_PAGINA...");
			}
	}
	public void setAtributoEtiqueas(String etiquetas){
			String[] lista = etiquetas.split("\\|");
			for(String s:lista){
            		agregarEtiqueta(s);
        	}
	}

	public void setAtributoEtiqueas2(String etiquetas){
			String[] lista = etiquetas.split("\\|");
			for(String s:lista){
            		agregarEtiqueta2(s);
        	}
	}

	public void agregarPaginaHija(String id){
			boolean add=true;
			for(String s: this.listaPaginasHijas){
				if (s.equals(id)){
					/* code */
					add=false;
					break;
				}
			}
			if (add){
				listaPaginasHijas.add(id);
			} else {
				listaErrores.add("Error: Existen paginas Hijas con el mismo nombre en la accion NUEVA_PAGINA...");
			}
	}

